    vector <vector<int>> v(n, vector<int> (n));
    vector <int> y(n,999999);
    queue<int> q;
    vector <int> s(n);
    vector<int>gl(1);
    for(int i=0;i<n;++i)
    {
        for(int j=0;j<n;++j)
            cin>>v[i][j];
    }
