    bool x=true;
    y[a]=0;
    q.push(a);
    while(!q.empty())
    {
        sort(gl.rbegin(),gl.rend());
        i=gl[(int)gl.size()-1];
        for (int k=0;k<n;++k)
        {
            if (y[k]==i)
            {
                i=k;
                k=n;
                x=true;
            }
            else
            {
                x=false;
            }
        }
        if (x==false)
        {
            gl.pop_back();
            q.pop();
        }
        else
        {
