        for(int j=0;j<n;++j){
            cin>>v[i][j];
        }
    }
    p[m]=1;
    d[m]=0;
    priority_queue<pair<int,int>>pops;
    pops.push(make_pair(0,m));
    while(!pops.empty()){
        pair<int,int>doc;
        doc=pops.top();
        pops.pop();
        doc.first*=-1;
        p[doc.second]=1;
        for(int i=0;i<n;++i){
            if(p[i]||v[doc.second][i]==0) continue;
            k=doc.first+v[doc.second][i];
            if(k<d[i]){
                d[i]=k;
            }
            pops.push(make_pair(-k,i));
        }
    }
    for(int i=0;i<n;++i){
        if(d[i]==9999){
            cout<<"-1";
        }
        else
        cout<<d[i]<<" ";
    }
